import React, {useState} from "react";

import {
  Formulario,
  Label,
  Input,
  GrupoInput,
  LeyendaError,
} from "../FormularioSolicitud/elementos/Formularios";

const RtaTramite = () => {

  const [nombre, setNombre] = useState("")
  const [sabor, setSabor] = useState("")

  return (
    <main>
      <Formulario action="">
        <div>

          <GrupoInput>
            <Label htmlFor="nombre">Nombre</Label>
            <Input 
              type="text" 
              id="nombre" 
              name="nombre" 
              placeholder="Ej. paco" 
              value={nombre}  
              onChange={(e) => setNombre(e.target.value)} //Elemento input y textarea
            />
          </GrupoInput>
          <LeyendaError>
            Este campo es requerido, y solo acepta n√∫meros
          </LeyendaError>
        </div>
        <div>

        </div>
        <p>Elige tu sabor JS favorito</p>
        <input 
          type="radio" 
          id="" 
          name="sabor" 
          value="" 
          onChange={(e) => setSabor(e.target.value)} 
        />
        <Label htmlFor="">

        </Label>
      </Formulario>
    </main>
  );
};
export default RtaTramite;
